function submitTransaction() {
  const secret = document.getElementById("secret").value.trim();
  const destination = document.getElementById("destination").value.trim();
  const amount = document.getElementById("amount").value.trim();
  const output = document.getElementById("output"); // किसी div ya pre element me show karne ke liye

  if (!secret || !destination || !amount) {
    output.textContent = "❗ Please fill all fields.";
    return;
  }

  fetch("/.netlify/functions/submitTransaction", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({ xdr: transaction.toXDR() })
      })
    .then((res) => res.json())
    .then((result) => {
      if (result.success) {
        output.textContent = "✅ Success:\n" + JSON.stringify(result.response, null, 2);
      } else {
        output.textContent = "❌ Error: " + result.error;
      }
    })
    .catch((err) => {
      output.textContent = "❌ Fetch Error: " + err.message;
    });
}

